import {useState, useEffect} from 'react';

const ProjectText = ({onPositionChange}) => {
  const [trans, setTrans] = useState({x: 0});

  useEffect(() => {
    onPositionChange(setTrans);
  }, [])

  return (
    <div
      className='Outer-projects'
      style={{
        transform: `translate(${trans.x}px, 0px)`,
      }}
      >
      <h1 className='Project-header'>{`PROJECTS`}</h1>
      <div className='Project-buttons'>
        <div>
          <a className='button'>This website</a>
          <div className='Website-description'>
            <h1>{`\A visual introduction to myself and a showcase of\nprevious work created using ReactJS and MatterJS
            `}</h1>
          </div>
        </div>
        <div className='Indiv-project'>
          <a className='button'>SPACBOT</a>
          <div className='Website-description'>
            <h1>{`A bot that scrapes the web and collects data from\nReddit, Yahoo Finance, Google News, and SEC.gov\non SPAC tickers and other SPAC-related news and\ninformation. Useful information is relayed to Discord\nto provide knowledge and alerts that can assist in\nSPAC investment.
            `}</h1>
          </div>
        </div>
      </div>

    </div>
  )
}

export default ProjectText;
